  `name` varchar(50) NOT NULL COMMENT '名称',
  `resourcesType` varchar(10) NOT NULL COMMENT '资源类型（Food; Speciality; Repast; Shopping; Hotel）',
  `price` varchar(100) DEFAULT NULL COMMENT '价格',
