INSERT INTO `t_cityresources_cn` VALUES ('151', '330100RS0008', '胡庆余堂', 'Shopping', '价格按时间会涨幅', '闻名遐迩的“江南药王”，是以宋代皇家的药典为本，选用历朝历代的验方，以研制成药著称于世，一直到今天仍为中外人士所喜用，它和北京的同仁堂并称为中国著名的南北两家国药老店', '', '中山中路49号', '1', '1', '0571-87064621', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('152', '330100RS0009', '中国丝绸城', 'Shopping', '', '杭州丝绸品种繁多，最著名的品牌有：喜得宝、万事利、凯地等。全真丝织物价格大约是化纤、仿真丝绸缎的两倍左右', '', '西健康路五号丝绸市场72-18号', '1', '1', '400-600-5537', '0', '', '', '0');
