INSERT INTO `t_cityresources_cn` VALUES ('154', '330100RS0011', '西湖绸伞', 'Speciality', '参考价格50-300', '全称“西湖竹骨绸伞”，西湖绸伞为西湖特产之一。创始于本世纪（20世纪）30年代初。造型灵巧、色彩鲜艳，既可遮蔽阳光，又可作为装饰品，具实用性与艺术性于一体，故素有“西湖之花”的美称', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('155', '330100RS0012', '吴山夜市', 'Shopping', '', '这是杭州最老、最热闹的一条夜市，大城市里，还有容许摆夜市的地方已不多了。吴山夜市东面出口，有个热闹的花鸟市场，再过一点是中山中路，有着千年历史的商业老街；夜市南面是官巷口、解放路，是近百年来的市中心商业圈', '', '吴山路', '1', '1', '', '0', '', '', '0');
