INSERT INTO `t_cityresources_cn` VALUES ('205', '350100RS0006', '7天连锁酒店（东街口店）', 'Hotel', '网络价167', '', '', '鼓楼区东街口省府西路元帅庙小区', '1', '1', '0591-87506288', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('206', '350100RS0007', '鼎边糊', 'Food', '参考价格6', '是用大米加清水磨成浓浆，摊在锅边，半熟后铲入正在熬煎的虾汤中，煮制而成', '', '推荐：福记鼎边糊 地址：鼓楼区南后街', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('207', '350100RS0008', '肉丸', 'Food', '参考价格9', '采用芋头、薯粉、猪肉、红枣、芝麻、红糖等为原料，加工成一料料蒸熟的肉丸，甜中带咸，咸甜适口', '', '推荐：木金肉丸老铺 地址：鼓楼区南后街澳门路', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('208', '350100RS0009', '肉燕', 'Food', '人均消费12', '将猪腿瘦肉用木棒打成肉泥，掺上蕃薯粉擀成粉片般薄包上肉馅，煮熟配汤吃，味鲜适口。', '', '推荐：同利肉燕老铺 地址：鼓楼区澳门路3号（林则徐纪念馆对面）', '1', '1', '0591-87515631', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('209', '350100RS0010', '太极芋泥', 'Food', '', '以当地盛产的槟榔芋为原料，加糖、猪油蒸制而成。此菜形色古朴大方，芋泥细腻润滑，香甜可口', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('21', '530100RS0001', '过桥米线', 'Food', '12-100元不等', '过桥米线由三部分组成，一是鸡汤，二是切成片类的食品，其中包括生的薄肉片、腰片、鸡片、鱼片各一盘，加上处理过的豆腐皮、韭菜、绿豆芽、豌豆尖、香菜和葱各一盘。三是煮好的米线。口味：咸鲜。', '', '建新园  地址：昆明市五华区宝善街195号（近消防队）  电话：08713135545  桥香园  地址：昆明市西山区书林街2号（近金碧广场）  电话：0871-3645275', '1', '1', '', '0', '', '建新园  地址：昆明市五华区宝善街195号（近消防队）  电话：08713135545桥香园  地址：昆明市西山区书林街2号（近金碧广场）  电话：0871-3645275', '0');
INSERT INTO `t_cityresources_cn` VALUES ('210', '350100RS0011', '佛跳墙', 'Food', '', '福州传统名菜。其原料有18种之多，海参、鲍鱼、鱼翅、干贝等。先把18种原料分别采用煎、炒、烹、炸多种方法，炮制成具有它本身特色的各种菜式，然后一层一层地码放在一只大绍兴酒坛子里，注入适量的上汤和沼兴酒，使汤、酒、菜充分融合，再把坛口用荷叶密封起来盖严，放在火上加热', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('211', '350100RS0012', '荔枝肉', 'Food', '', '福州传统名菜。制法是将猪瘦肉剞上十字花刀，切成斜形块，炸后会卷缩成荔枝形，佐以番茄酱、香醋、白糖、酱油等调料即成', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('212', '350100RS0013', '聚春园大酒店中餐厅', 'Repast', '人均消费225', '老字号闽菜馆。福州传统菜肴相当出色', '', '鼓楼区八一七北路101号聚春园大酒店3楼', '1', '1', '0591-87533604', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('213', '350100RS0014', '邓记饭庄', 'Repast', '人均消费35', '福州家常小店，但闽菜也做得十分正宗', '', '鼓楼区八一七路（近东街口黄巷）', '1', '1', '0591-87621084', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('214', '350100RS0015', '福州角梳', 'Speciality', '参考价格20', '采用中国南方水牛角和北方和绵羊角为原料，经过精细的工艺制成', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('215', '350100RS0016', '福州纸伞', 'Speciality', '参考价格55', '福州三宝之一，历史悠久，做工精细，采用油画、彩画喷花和绢印等方法，在纸伞上绘制了花鸟、山水、人物等图案，十分雅致美观', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('216', '350100RS0017', '脱胎漆器', 'Speciality', '参考价格500（小件）', '中国传统工艺“三宝”之一，是具有独特民族风格和浓郁地方色彩的艺术珍品', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('217', '350100RS0018', '南后街（三坊七巷）', 'Shopping', '', '是从福州三坊七巷兴起的主要的商业街，路面商贾云集。可购买到各种福州特产', '', '福州市鼓楼区南后街', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('218', '350100RS0019', '福州漆艺术苑', 'Shopping', '', '专门售卖福州脱胎漆器，其中三楼为脱胎漆器创新中心及保护基地', '', '福州市晋安区远洋路75号', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('219', '130800RS0001', '莜面窝子', 'Food', '', '是将莜面皮卷成卷，上锅蒸熟，吃的时候蘸酱', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('22', '530100RS0002', '宣威火腿', 'Food', '每500克30-100元不等', '宣威火腿又称云腿，是由猪腿肉腌制而成。云腿肉质红白鲜艳，具有独特的风味和香气，且便于长期保存，口味鲜、酥、脆、嫩、香甜。', '', '', '1', '1', '', '0', '', '昆明市五华区大观商业城   也可在各大商场购买到宣威火腿', '0');
INSERT INTO `t_cityresources_cn` VALUES ('220', '130800RS0002', '碗坨', 'Food', '', '是由荞麦面同猪血制成，食用时放油锅中煎制，再加上各种酱料', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('221', '130800RS0003', '鲜花玫瑰饼', 'Food', '参考价格10元', '以当地特产鲜玫瑰花为主要原料，采有传统工艺精制而成。是清朝年间宫廷御膳食品之一。吃起来绵软酥松', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('222', '130800RS0004', '新乾隆酒楼', 'Repast', '人均消费70', '承德一家老字号饭店', '', '承德市新华路帝景园大厦', '1', '1', '0314-2072222', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('223', '130800RS0005', '大清花饺子馆', 'Repast', '人均消费40元', '门前装饰这两个木质的秋千，还摆上了一些仿古的轮车', '', '丽正路19号', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('224', '130800RS0006', '塞外酒家', 'Repast', '人均消费50', '', '', '避暑山庄德惠门西侧', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('225', '130800RS0007', '金桥乔家八大碗', 'Repast', '人均消费70', '', '', '市中心火神庙流水沟太平桥一号', '1', '1', '0314-2037888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('226', '130800RS0008', '避暑山庄丝织挂锦', 'Speciality', '参考价格300', '采用我国传统的“中堂画”表现形式，在淡黄色或浅灰色的缎面上，绘出一组组避暑山庄特有的山水园林建筑，亭台楼阁、山泉林瀑一应俱全。丝织挂锦图案色彩典雅清新，运用了宫庭画中典型的工笔写实手法，有鲜明的地域特征和民族风格', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('227', '130800RS0009', '承德木雕', 'Speciality', '参考价格200-500', '是承德有名的工艺品，以承德山区特有的名贵木材为原料，制成手杖、家具或其它工艺品，并在上面雕刻出极具特色的图案。承德手杖以山核桃壳和山城珍木“明开夜合木”为原料，山核桃壳是承德山区的一种土特产品，外壳质地坚硬，纹理清晰', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('228', '130800RS0010', '滕氏布糊画', 'Speciality', '参考价格128（小摆件）', '滕氏布糊画在中国传统画的基础上，又加上了民间剪纸、刺绣、雕塑等的创作技法，作品内容以人物花鸟、亭台楼阁为主，用料讲究、色彩绚丽，人物形象情态可掬，楼阁线条清晰多变，兼具西方油画效果，形成自己的独特风格', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('229', '130800RS0011', '承德百分百快捷商务酒店', 'Hotel', '网络价158', '', '', '承德市双桥区桃李街26号（承德电大南侧）桃李街南口', '1', '1', '0314-7779888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('23', '530100RS0003', '黄焖鸡', 'Food', '', '黄焖鸡是采用山区土鸡，配以十几种配料，焖制而成。原汁原味，汁浓味醇。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('230', '130800RS0012', '山庄宾馆', 'Hotel', '参考价格200', '', '', '双桥区丽正门大街11号', '1', '1', '0314-2091188', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('231', '130800RS0013', '锦江文冠饭店', 'Hotel', '参考价格180', '附近环境优美，坐落在半山腰，周边游魁星楼和僧冠峰两大景区', '', '双桥区环城南路99号僧冠峰景区', '1', '1', '0314-2295588', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('232', '350700RS0001', '九曲竹筏', 'Food', '', '竹筏”是用香菇、精肉或鲜河鱼切成末做肉馅，再用笋片将其卷成长筒形，似根根毛竹，前端再用一把细竹技横穿而过，使之微微上翘。九曲竹筏不仅造型逼真，入口外脆里嫩，味道十分鲜美', '', '推荐：武夷宾馆 地址：南平市延平区横排路38号', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('233', '350700RS0002', '苦槠糕', 'Food', '', '用山中野生的苦槠等壳斗科植物的果仁磨成浆，加热调成块状软糕，再加佐料清煮，味道可口又带涩', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('234', '350700RS0003', '胡麻饭', 'Food', '', '糯米用水浸透后蒸熟，置石臼中用木槌打烂、揉成小团，拌上芝麻、白糖，香甜可口', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('235', '350700RS0004', '凉水仔', 'Food', '参考价格2-3', '用野生的薜荔果，将仔剥出曝晒后加工制成的半凝固凉饮料，调以蜂蜜食用，带有淡淡的甜味', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('236', '350700RS0005', '饴仔', 'Food', '参考价格1-2', '用稠米浆为皮，馅有甜咸两味，外面用芭蕉芋叶包成长方形', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('237', '350700RS0006', '火烧豆荚', 'Food', '', '中秋节前后正是田埂豆饱满之时，在坪上架起一堆火，将田埂豆连杆带荚挂在火上烧熟，剥皮后食之，有一种特殊的田园风味，口味咸香', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('238', '350700RS0007', '蛇宴', 'Food', '', '武夷山是“蛇的王国”，各种蛇宴花样繁多，美味无比。主要有炒龙排、炒龙蛋、煮龙珠、蛟龙戏水、龙虎斗等。特别是龙凤汤，“汤清见底，面无油珠，肉烂无腥”，口味咸鲜香', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('239', '350700RS0008', '小红袍', 'Speciality', '参考价格110/斤', '', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('24', '530100RS0004', '路南乳饼', 'Food', '', '乳饼是选用新鲜羊奶，煮沸加入食用酸，凝固后加压制成块状。优质乳饼色白略带黄色，表面有油质，无酸味。乳饼的吃法很多，可煎、蒸、煮、烤，切丝炒肉，还可生吃。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('240', '350700RS0009', '五步蛇酒', 'Speciality', '参考价格120/瓶（2斤装）', '对于治疗风湿性关节炎，坐骨神经痛、破伤风、皮肤瘙痒等具有良好的疗效', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('241', '350700RS0010', '武夷山悦华酒店', 'Hotel', '网络价798', '', '', '武夷山市国家旅游度假区', '1', '1', '0599-5238999', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('242', '350700RS0011', '武夷山海晟国际大酒店', 'Hotel', '网络价455', '', '', '武夷山市文公路58号', '1', '1', '0599-5322222', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('243', '350700RS0012', '武夷山庄', 'Hotel', '网络价498', '武夷山庄依山傍水，环境清雅，占地百亩，绿化面积在80％以上，平均一间客房拥有一亩绿地，素有“人间仙居”之美称', '', '武夷山市武夷宫', '1', '1', '0599-5255800', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('244', '350700RS0013', '如家快捷酒店（武夷山大王峰店）', 'Hotel', '网络价211', '', '', '武夷山市国家旅游度假区北京山庄', '1', '1', '0599-5237888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('245', '360400RS0001', '庐山石鸡', 'Food', '', '庐山石鸡是一种生长在阴涧岩壁洞穴中的麻皮蛙，它的形体与一般青蛙相似，但体大，肉肥，一般体重三四两，大的重约一斤左右。因其肉质鲜嫩，肥美如鸡而得名', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('246', '360400RS0002', '庐山石鱼', 'Food', '', '庐山石鱼体色透明，无鳞，其肉细嫩鲜美，味道香醇，闻名遐迩', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('247', '360400RS0003', '黄焖石鸡', 'Food', '', '黄焖石鸡是将石鸡斩头去爪，洗净内脏，切成块状过油，佐以四米，加黄酒、酱油、盐、高汤用小火焖熟，用旺火收汁，淋香油即可。此菜醇香，肥美，味道十分可口', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('248', '360400RS0004', '茶饼', 'Food', '', '选用当地茶油、麦面、黑芝麻、百年桂花为主要原料，采用传统工艺和现代技术研制而成', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('249', '360400RS0005', '庐山云雾茶', 'Speciality', '', '庐山的土特产中，庐山云雾茶名气最大，它是中国十大名茶之一', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('25', '530100RS0005', '汽锅鸡', 'Food', '', '云南具有独特风味的滋补名菜，其做法是先将三七细根，装入已清洗干净的鸡腹内，将鸡块置于汽锅内，配上佐料，然后放在一只盛有四五公斤水的砂锅上，用旺火炖制而成。口味：肥嫩鲜香，汤汁鲜甜。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('250', '360400RS0006', '鄱阳湖竹荪', 'Speciality', '', '竹荪是世界上最珍贵的食用菌之一。因其具有优美的体姿、鲜美的口味和丰富的营养成分而被人们誉为“真菌皇后”、“真菌之花”', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('251', '360400RS0007', '庐山北斗星国际饭店', 'Hotel', '参考价格931-980', '饭店座落于庐山东谷别墅区大月山腰际，海拔高约1200米，环境优美、视线开阔，放眼远 眺，牯岭山城尽收眼底', '', '庐山市汉口峡路40号', '1', '1', '0792-8290999', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('252', '360400RS0008', '庐山国脉宾馆', 'Hotel', '参考价格385-460', '庐山国脉宾馆又称庐山邮电疗养院，地处吼虎岭上，面临芦林湖，背依大月山，这里松柏环抱，山花簇拥，空气清新，林间别墅石径相通，是亲近大自然，尽享大自然恩赐的极好场所', '', '庐山大月山路15号', '1', '1', '0792-8297666', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('253', '360400RS0009', '庐山宾馆', 'Hotel', '参考价格230-260', '庐山宾馆是全国优秀星级宾馆，安全舒适、服务优质，地理位置靠牯岭闹市中心，交通便利，是春、夏、秋、冬四季来庐山旅游观光、举办学术交流、各种会议、休闲避暑最佳选择', '', '庐山河西路70号', '1', '1', '0792-8282060', '0', '', '', '0');
