INSERT INTO `t_cityresources_cn` VALUES ('26', '530100RS0006', '石屏会馆', 'Repast', '人均消费100元左右', '石屏会馆是一间非常有云南特色的餐厅，有不少本地特色的美食，石屏豆腐就是其中之一，烤得脆脆的，特别香。而且环境很好，三进的院子，走马转角楼风格的二层木制建筑，古典的家具摆设，为这里平添了独特的历史气息，斜坐在楼梯上凭栏而望，真是有种恍如隔世的感觉。', '', '昆明市五华区翠湖南路中和巷24号', '1', '1', '0871-3627444  0871-3627222', '0', '', '黄焖鸡  石屏豆腐  石屏煎鱼  汽锅鸡  凉拌木耳  乳饼等', '0');
