INSERT INTO `t_cityresources_cn` VALUES ('28', '530100RS0008', '1910火车南站', 'Repast', '人均消费60元', '这个叫做“1910火车南站”的主题餐厅就开设在离南站原址不远处的一栋20世纪初的法式建筑内，院内放置着一些老式铁路的设备，有一条西南特色的米轨，还有一些老照片，很怀旧的感觉。', '', '昆明市西山区后新街8号 ', '1', '1', '0871-3169486', '0', '09：00-21：00', '金条稀豆粉  麻辣小猪手  老奶土豆泥  花椒香肠  豆焖饭', '0');
INSERT INTO `t_cityresources_cn` VALUES ('280', '150100RS0013', '昭君大酒店', 'Hotel', '门市价480 网络价265-348', '酒店内特有的昭君文化，时刻让您沉醉于单于和亲昭君出塞的历史文化中。酒店内设有粤香园、西亚食府、萨拉伯尔、上岛咖啡四大主题风味餐厅', '', '新城区新华大街69号', '1', '1', '0471-6668888', '0', '', '', '0');
