INSERT INTO `t_cityresources_cn` VALUES ('288', '532900RS0006', '一根面', 'Food', '参考价格5元/碗', '一碗面就是一根，一锅面也是一根，一家人吃的面还是一根，既寓意着传宗接代根脉不断，又是地道的吉祥美食。一根面在于吃面条的原汁原味', '', '', '1', '1', '', '0', '', '', '0');
