INSERT INTO `t_cityresources_cn` VALUES ('292', '532900RS0010', '大理亚星大饭店', 'Hotel', '门市价1035 网络价500', '酒店拥有310间可直观苍洱风光的客房。客房内设施完善，风格独特，温馨古雅，有仿古太师椅、筒形红木矮几等配置。餐厅采用大理传统装饰，环境优雅', '', '云南大理古城旅游度假区', '1', '1', '400-628-1999', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('293', '532900RS0011', '大理古城兰林阁酒店', 'Hotel', '门市价600 网络价340', '是大理古城唯一的一家以白族庭院式展示白族建筑不同格局的酒店。全酒店集中反映出\"三坊一照壁、四合五天井、六合同春\"的民族风韵', '', '大理古城玉洱路96号', '1', '1', '0872-2188188', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('294', '532900RS0012', '云上四季酒店（大理中和居店）', 'Hotel', '门市价380 网络价204', '大理云上四季酒店座落在闻名遐迩的大理古城洋人街。整个建筑分为两院，结合了白族民居经典的“三方一照壁”、“四合五天井”、“六合同春”的建筑风格，采用了白族民居建筑形式与现代建筑风格相结合的结构式样，以白族民居建筑形式为主体，充分体现了白族民居建筑的风格特色。灰砖灰瓦，雕梁画栋让人寻得到早先官宦宅邸的门庭气派和典雅', '', '大理市古城护国 路31号', '1', '1', '0872-2680588', '0', '', '', '0');
