INSERT INTO `t_cityresources_cn` VALUES ('297', '520100RS0003', '丝娃娃', 'Food', '人均消费20', '丝娃娃是用大米面粉烙成的薄饼，卷入萝卜丝、折耳根、海带丝、炸黄豆、糊辣椒等。又名素春卷。口味酸酸辣辣', '', '推荐：杨姨妈丝娃娃（飞山街店） 地址：云岩区飞山街214-2号', '1', '1', '0851-5289558', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('298', '520100RS0004', '肠旺面', 'Food', '人均消费10', '肠旺面是贵州极负盛名的一种风味小吃。“肠”是猪大肠，“旺”是猪血，浇入煮好的鸡蛋面条中，血嫩、面脆，口味辣香汤鲜', '', '推荐：金牌罗记肠旺面 地址：云岩区蔡家街（近中山东路）', '1', '1', '', '0', '', '', '0');
