INSERT INTO `t_cityresources_cn` VALUES ('30', '530100RS0010', '云南人家', 'Repast', '人均消费100元左右', '这间餐厅装修得很考究，古朴典雅，扑面而来是云南原生气息，木制结构古意盎然，小桥流水展现古诗里的美妙意境，韵致天成。在云南人家还有一个小型博物馆，珍藏了不少民族艺术品，在饭前可以漫步参观。而这家餐厅除了当地云南特色菜以外，就是晚上的风俗表演啦。吃晚餐的时候可以边吃着云南的特色菜肴，边欣赏着云南少数民族聚亲的风俗。', '', '昆明市官渡区宝海路146号', '1', '1', '0871-7158886', '0', '', '云南米酒  竹筒饭  过桥米线  青瓦丽江鱼', '0');
INSERT INTO `t_cityresources_cn` VALUES ('300', '520100RS0006', '恋爱豆腐果', 'Food', '参考价格1元/个', '豆腐果是贵阳有名的风味小吃。由白豆腐经适量碱水发酵后，放在铁板上烤制并填料而成，吃起来外焦里嫩，咸辣爽滑，满口喷香', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('301', '520100RS0007', '酸汤鱼', 'Food', '', '苗族独有的食品，入口酸味鲜美，辣劲十足，令人胃口大开。一般是先加入特产糟辣椒和本地许多有营养的中草药，借番茄酸烹出自然酸汤，然后将清洗的活鱼下锅煮', '', '', '1', '1', '', '0', '', '', '0');
