INSERT INTO `t_cityresources_cn` VALUES ('305', '520100RS0011', '刺梨酒', 'Speciality', '参考价格30/瓶', '长期适量饮用，具有清热利尿，消食健胃，散瘀袪热的功效；由于它还含有活性物质——超氧化岐化酶，可以起到防癌和抗衰老的作用', '', '', '1', '1', '', '0', '', '', '0');
