INSERT INTO `t_cityresources_cn` VALUES ('347', '232700RS0009', '油炸糕', 'Food', '参考价格1元/个', '用糯米中间加豆馅，下油锅炸制而成。特点是糯米粘而津道，豆香浓郁', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('348', '232700RS0010', '烤狗鱼', 'Food', '参考价格6', '狗鱼当地人的吃法多数是红烧和烧烤，味道鲜美', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('349', '232700RS0011', '白肉血肠', 'Food', '参考价格30元/锅', '先将白肉上锅蒸20分钟，然后将血肠一起炖熟，色泽鲜明、口敢香醇', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('35', '530100RS0015', '撒尼挂包', 'Speciality', '价格在30元左右。', '它是一种生活用具，也是一种精美的民族民间工艺品，挂包的图案及挑花技巧，具有浓郁的民族特点和地方色彩，是云南民族挂包中的代表。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('350', '232700RS0012', '风干香肠', 'Food', '参考价格10', '香肠选用新鲜瘦肉，加有砂仁、桂皮、豆蔻等佐料，药香郁口。这种肠食之耐嚼，回味绵长，是佐酒之佳品，盛宴之珍馐', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('351', '232700RS0013', '鸡肉炖蘑菇', 'Food', '参考价格30元/锅', '鸡肉炖蘑菇是漠河具有地方特色的菜品之一，通常用来炖鸡的夏天一般用鲜蘑，冬天干蘑菇居多。此菜的特点是营养丰富、口感咸鲜', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('352', '232700RS0014', '野生黑木耳', 'Speciality', '参考价格90元/公斤', '是一种营养丰富的食用菌，它的别名很多，因生长于腐木之上，其形似人的耳朵，故名木耳', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('353', '232700RS0015', '牙格达果', 'Speciality', '', '那冰凌中绽放着沁人心脾的达子香花，厚厚的积雪下面是那绿绿的牙格达，仔细看还会有几颗红红的牙格达果', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('354', '232700RS0016', '灵芝', 'Speciality', '参考价格2元/克', '灵芝自古以来就被认为是吉祥、富贵、美好、长寿的象征，有“仙草”、“瑞草”之称，中华传统医学长期以来一直视为滋补强壮、固本扶正的珍贵中草药。民间传说灵芝有起死回生、长生不老之功效', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('355', '232700RS0017', '毛尖蘑菇', 'Speciality', '参考价格400元/千克', '毛尖蘑菇口感鲜美，味道极佳。毛尖蘑所含氨基酸、蛋白质、微量元素等是普通蘑茹的几倍至几十倍', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('356', '232700RS0018', '蓝莓', 'Speciality', '参考价格80-120元/斤', '又名：都柿，酸甜的蓝莓，天然的颜色，初恋的感觉，美丽惬意的让人神往', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('357', '232700RS0019', '榛子', 'Speciality', '参考价格30', '榛子果形似栗子，外壳坚硬，含油脂量很大，口感香美，余味绵绵，有“坚果之王”的称呼', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('358', '231000RS0001', '金鼎国际大酒店', 'Hotel', '参考价格280', '位于牡丹江市中心繁华商业区，酒店设计新颖，建筑独特，装饰典雅，其建筑及装潢体现了浓郁的后现代派现实主义风格', '', '牡丹江市西安区景福街99号', '1', '1', '0453-8939999', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('359', '231000RS0002', '贝壳连锁驿馆（太平路店）', 'Hotel', '参考价格108', '是牡丹江地区的城市主题快捷连锁旅馆，经营风格简约、精致、时尚、舒适', '', '西安区太平路与日照街交叉口（火车站前200米）', '1', '1', '0453-8930575', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('36', '530100RS0016', '扎染布', 'Speciality', '30元左右一件。', '扎染布是大理周城镇白族人民生产的传统染织品。它以当地土靛为染料，把原色白布，经过人工扎成“八卦图”、“蝴蝶”、“三塔倒影”、“梅花”等各种花样，放到染液中冷染十余次,一展开即得兰底白花图案。其特点是花色朴素大方，不易变色。制作服装、室内窗、门帘、台布、壁挂等装饰用料、还可制作纪念袋、纪念巾等多种旅游纪念品，深受游客的喜爱。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('360', '231000RS0003', '牡丹江饭店', 'Hotel', '参考价格148', '是牡丹江市最大的舒适型快捷酒店，至今建店50多年', '', '东安区光华街128号', '1', '1', '0453-6997888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('361', '231000RS0004', '夏威夷国际大酒店', 'Hotel', '参考价格400', '是黑龙江江达集团投资，按国际四星级标准兴建的融客房、餐饮、康体与商务为一体的智能化商务酒店', '', '东安区七星街95号', '1', '1', '0453-6388888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('362', '231000RS0005', '贝壳连锁驿站（站前店）', 'Hotel', '参考价格108', '是牡丹江地区首家城市主题快捷连锁驿馆，经营风格简约、精致、时尚、舒适', '', '东安区二条路与日照街交叉口', '1', '1', '0453-6936367', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('363', '231000RS0006', '江城饭店', 'Hotel', '参考价格108', '牡丹江江城饭店荣获雪城名牌企业称号，是集住宿餐饮于一体的综合酒店', '', '东安区市政路9号', '1', '1', '0453-6997388', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('364', '231000RS0007', '镜泊湖国际俱乐部', 'Hotel', '参考价格340', '牡丹江镜泊湖国际俱乐部依傍在牡丹江市国家级5A风景名胜区——镜泊湖，是镜泊湖唯一一家四星级、国际化、多功能的旅游商务酒店', '', '牡丹江镜泊湖山庄', '1', '1', '0453-6270222', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('365', '231000RS0008', '镜泊鲤鱼丝', 'Food', '参考价格15元/份', '选用镜泊的金鲤鱼，取其肉放在陈醋浸后，再浇入鲜嫩黄瓜汁、香菜汁、糖蒜汁、小磨香油、姜汁等佐料，味道咸鲜美', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('366', '231000RS0009', '镜泊湖鱼宴', 'Food', '', '镜泊湖水产丰富，盛产鲫鱼，称“湖鲫”，体大肥胖，一条可达两三斤，肉质细嫩味鲜，用以烹制鱼汤或红烧，味道鲜美', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('367', '231000RS0010', '石锅拌饭', 'Food', '参考价格15', '特点是米饭香软，蔬菜清脆可口，肉末肥而不腻，鸡蛋只煎单面，蛋黄内融外凝，与肉末、蔬菜、米饭拌在一起非常鲜美。要是再加上朝鲜族的特色辣酱', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('368', '231000RS0011', '土豆红豆面团粥', 'Food', '参考价格5', '将土豆和红豆做成丸子，放在锅中煮熟，放入冰糖等调味料。', null, null, '1', '1', null, '0', null, null, '0');
INSERT INTO `t_cityresources_cn` VALUES ('369', '231000RS0012', '玫瑰酥饼', 'Food', '参考价格20', '用面粉、白糖等烤制而成。具有甜香酥脆，花香气浓的特点', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('37', '530100RS0017', '乌铜走银', 'Speciality', '价格在100到600元左右。', '这是云南独特的工艺美术技艺。产品以乌铜为胎，在胎上雕刻各种花纹图案，以金或银冷嵌其间，即呈现黑黄或黑白分明的装饰效果，色态极其雅致。如使乌铜走银与斑铜和锡制工艺品相结合，装饰效果显得更加鲜艳明朗。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('370', '231000RS0013', '筋饼', 'Food', '参考价格3', '用面粉制成，多数早餐点都有售，饼外酥内软，口味有甜、咸两种', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('371', '231000RS0014', '狗肉汤', 'Food', '人均消费40', '有狗肉为主要材料煮成的汤，味道鲜美', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('372', '231000RS0015', '鸡肉炖蘑菇', 'Food', '参考价格30', '将鸡块和各种调料放入汤锅炖熟炖出的蘑菇滑嫩松软，味道咸鲜美', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('373', '231000RS0016', '百年酱骨', 'Repast', '', '本店是牡市首家以古朴的武林文化与现代中式风格的一个完美结合', '', '东一条路南市街花鸟鱼市场南门', '1', '1', '0453-6332333', '0', '9:00-21:00', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('374', '231000RS0017', '吉园村饭店', 'Repast', '', '吉园村饭店，特色驴肉。驴肉以奇香而闻名,民间有“天上龙肉，地上驴肉”之说，以此来形容驴肉之美味', '', '西七条路牡丹街与长安街之间', '1', '1', '0453-5966866 13946341503 13946332290', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('375', '231000RS0018', '板门店风味烤肉', 'Repast', '人均消费38', '', '', '西安区西四条路牡丹街口', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('376', '220100RS0001', '长春饭店', 'Repast', '', '', '', '南关区重庆路57号', '1', '1', '0431-88918322', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('377', '220100RS0002', '龙家堡', 'Repast', '人均消费35', '', '', '绿园区和平大街绥中路7号春天家园正门西侧', '1', '1', '0431-87992169', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('378', '220100RS0003', '北国之春大酒店', 'Repast', '', '长白山珍宴共分六道大菜，采用长白山得天独厚的特产——人参、鹿茸、熊掌、飞龙、雪蛤、松茸蘑等数十种珍稀产品为原料，集中国传统宴席之荟萃，做工精细，席面优美华贵，色彩灿烂。配料特点是药膳结合，食助药性，药助食威', '', '重庆路48号', '1', '1', '0431-88931740', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('379', '220100RS0004', '名门大酒店', 'Repast', '', '翡翠人参茅台鸡此菜将母鸡、茅台酒、吉林人参汇于一菜，烹调制成。该菜色彩绚烂，口味咸鲜', '', '朝阳区人民大街4501号（隆礼路口）', '1', '1', '0431-85622888 85565666', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('38', '530100RS0018', '傣家竹编', 'Speciality', '价格在30到100元左右。', '竹编是傣家人擅长的工艺。如果你有机会到傣乡作客，一踏上那别致的竹楼，仿佛进入了一个竹子编织的世界：墙壁用竹子编成，地毯是竹编席垫，室内陈设的家具什物，大到衣柜，小到饭盒、小凳，以及凉帽、雨帽，随身携带的小背篓，无一不是竹编的。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('380', '220100RS0005', '禧福德花园酒店', 'Repast', '参考价格20', '烧鹿尾这道菜皮烂肉香，汁红色亮，味道醇厚，被赞为“味中奇”', '', '南关区人民大街高速路口（近雕塑公园）', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('381', '220100RS0006', '王记酱骨头', 'Repast', '', '这种酱骨头分为脊骨和棒骨两种。脊骨吃肉、棒骨吸髓，香腻十足。这店里的土豆酱也是用酱骨头汤做成的，很有特色。味道鲜美', '', '朝阳区西民主大街1059号', '1', '1', '0431-88546888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('382', '220100RS0007', '满族八大碗', 'Food', '人均消费37', '它由雪菜炒小豆腐、卤虾豆腐蛋、扒猪手、灼田鸡 、小鸡珍蘑粉、年猪烩菜 、御府椿鱼 、阿玛尊肉等八种菜组成', '', '朝阳区同光路（吉祥茶馆边）', '1', '1', '0431-82233397', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('383', '220100RS0008', '千豆腐串', 'Food', '参考价格0.5', '即是把干豆腐穿成串，辅以鸡汤，或炖或熏，朴实的豆腐便染上了鸡肉的鲜香。而又以老韩头豆腐串最为有名', '', '宽城区长新街扶贫市场满克隆超市2楼', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('384', '220100RS0009', '雪衣豆沙', 'Food', '', '豆沙泥裹着面粉油炸，送上桌时，在盘子里防止白色的糖粉，沾着吃，这道甜品的妙处在与豆沙泥', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('385', '220100RS0010', '阿斯旺美食广场', 'Repast', '人均消费37', '', '', '南关区长通路548号（近东四马路）', '1', '1', '0431-88754188', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('386', '220100RS0011', '熏肉大饼', 'Food', '', '选用上好的鲜猪肉煮熟,将大饼烙熟后,皮面金黄、圆如满月、层如翻书、外焦里嫩、松酥起层、滋味清香', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('387', '220100RS0012', '李连贵风味大酒楼（建设街店）', 'Repast', '人均消费41', '', '', '朝阳区建设街2788号', '1', '1', '0431-85629811', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('388', '220100RS0013', '德惠草编', 'Speciality', '参考价格10-15', '已有近百年的历史，除去人们常见的麦草，高梁杆皮编织品外，现以玉米皮制品为主，编制提篮、首饰盒、果盒、面包盘、座垫、茶垫、拖鞋、草制地毯等。其特点是柔软富有韧性、轻便、不传热', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('389', '220100RS0014', '长春木雕', 'Speciality', '参考价格500', '我国古老民间工艺之一,距今已有二千多年的历史,长春木雕是利用长白山根木,进行手工雕刻吉祥物、古今人物、神话人物等，造型美观，技艺高超，图案细致，形象生动，内容丰富多彩', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('39', '530100RS0019', '剑川木雕', 'Speciality', '价格在100到600元左右。', '剑川的木雕历史悠久，技艺精湛，有“木雕之乡”美称。剑川木雕用于室内厅堂摆设的桌、椅、凳、茶几，高档家具中有“双凤朝阳”、“飞龙揽云”、“孔雀开屏”等配套的家具多达24件，特别是在其间镶上大理石显得更加美观大方。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('390', '220100RS0015', '人参', 'Speciality', '参考价格180', '关东三宝之一。为多年生草本植物,素有“百草之王”美称', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('391', '220100RS0016', '鹿茸', 'Speciality', '参考价格2-8元/克', '关东三宝之一。主产于长白山区，取自梅花鹿新生的没有长成硬骨时的嫩角。因其营养丰富，药效显著', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('392', '220100RS0017', '鼎丰真糕点', 'Speciality', '参考价格20元/千克', '已有60余年历史，风味独特，驰名各地。其中最奇特的有：萨其玛满族传统食品，还有传统油炸点心冰蓼花', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('393', '220100RS0018', '香格里拉大酒店', 'Hotel', '参考价格1265', '位于长春市最繁华的商业宝地,于饭店客房内登高远望可鸟瞰长春市整个街景', '', '南关区西安大路569号', '1', '1', '0431-88981818', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('394', '220100RS0019', '海航紫荆花酒店', 'Hotel', '参考价格498', '是按国际五星级标准建造的涉外饭店，饭店全部采用楼宇自控系统及计算机联网进行经营管理', '', '人民大街5688号', '1', '1', '0431-85563555', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('395', '220100RS0020', '南湖宾馆', 'Hotel', '参考价格498', '位于风景秀丽的南湖之滨，与四周林立的高楼漪水相望，成为喧嚣都市中一处清新洞天', '', '朝阳区南湖大路3798号', '1', '1', '0431-85586888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('396', '220100RS0021', '名门海航酒店', 'Hotel', '参考价格266', '坐落于长春市主要的交通干线人民大街， 长春名门海航酒店欧式的大堂风格独特，荣获国家设计金奖', '', '朝阳区人民大街4501号（隆礼路口）', '1', '1', '0431-85622888 85565666', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('397', '220100RS0022', '吉隆坡大酒店', 'Hotel', '参考价格308-358', '是一家位于长春市中心繁华商业区的豪华型饭店，带有浓郁的马来西亚民族风情，实行国际化管理', '', '南关区西安大路823号', '1', '1', '0431-88962688', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('398', '220100RS0023', '7天连锁酒店长春重庆路店', 'Hotel', '参考价格308-358', '位于南关区商业中心地带，是长春老城区中心位置， 最晚担保时间:18:00', '', '南关区西四马路555号', '1', '1', '0431-88769188', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('399', '220100RS0024', '春谊宾馆', 'Hotel', '参考价格328（迎宾楼） 420（贵宾楼）', '春谊宾馆原为“大和旅馆”，国家文物保护单位，始建于1909年', '', '人民大街80号', '1', '1', '0431-82096000', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('4', '230100RS0004', '大列巴', 'Food', '参考价25元一个', '大列巴是哈尔滨最有个性的特产，又叫大面包，这种大面包为圆形，有五斤重，是面包之冠。秋林牌大面包沿用传统工艺，烘烤一小时左右外壳微焦而脆，内瓤松软可口；用酒花发酵，使面包具有诱人的酒花芳香；传统三次发酵工艺，使面团发酵充分，风味独特。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('40', '530100RS0020', '七彩云南', 'Shopping', '', '七彩云南，位于昆明至石林公路旁，距昆明12公里。它集旅游、休闲、观光、餐饮和购物为一体，是一个占地3万6千平米的大院。院的中间有许愿池，池畔绿树掩映，池水清澈见底，池中有七尊三国人物的雕像。', '', '昆明至石林公路旁，距昆明12公里。', '1', '1', '', '0', '', '', '0');
