INSERT INTO `t_cityresources_cn` VALUES ('41', '530100RS0021', '建水紫陶', 'Speciality', '价格在100到300元左右。', '建水民间传统工艺品，始于元末明初。用建水近郊五色陶土制作成型，经过书画、雕刻、填刮、烧炼、磨光等工序，陶器色泽深紫，花纹雪白，叩声如磐。其中深黑嵌白者，尤为上品。建水紫陶品种繁多，有煮器具、茶具、花盆及案头陈列装饰用品等。造型大多古朴典雅，别具一格，用作蒸具，可蒸鸡、鸽等肉食品 。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('410', '210100RS0011', '满汉全席', 'Food', '', '满汉全席突出以文宴、武宴、官宴和民宴为主', '', '推荐：沈阳御膳酒楼 新世界大酒楼', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('411', '210100RS0012', '老边饺子馆', 'Repast', '人均消费49', '老边饺子制作精细、造型别致、皮薄肚饱、馅鲜味好。邓小平同志到沈阳视察时，品尝过边霖包制的饺子，吃后非常高兴地说：“老边饺子有独特之处，要保持下去。”我国著名的艺术大师候宝林亲临品尝老边饺子，席间余兴未尽，挥毫写了八个大字：“边家饺子，天下第一”', '', '沈河区中街路208号（玫瑰大酒店对面）', '1', '1', '024-24865369', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('412', '210100RS0013', '老山记海城馅饼', 'Repast', '人均消费31', '沈阳市传统风味小吃，由毛青山于1920年创始于辽宁海城县城火神庙街，1939年迁到沈阳。馅饼成品形圆色黄，皮面脆韧，馅心嫩爽，鲜香四溢。配以蒜泥、辣椒油、芥茉糊等蘸食，更加味美适口。备八宝粥佐之，清爽可口，风味别样', '', '和平区南五马路131号（近宜兰街）', '1', '1', '024-23238022', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('413', '210100RS0014', '马家烧麦', 'Repast', '人均消费36', '是沈阳市著名的清真风味小吃，已有180多年的历史，享誉沈阳地区。产品特点：皮薄光亮，筋道柔润，鲜嫩松散，味道醇香', '', '和平区太原北街北四路12号', '1', '1', '024-83831777 83831555', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('414', '210100RS0015', '不老林糖', 'Speciality', '参考价格2.7元/100克', '不老林糖是沈阳人引以为傲的老字号特产，包含了几代人的甜蜜的回忆，是逢年过节必备的糖果之一', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('415', '210100RS0016', '羽毛画', 'Speciality', '参考价格450-3000元价格不等', '羽毛画是采用大自然中各种禽鸟的羽毛，经过剪、拼、叠、镶及热压成形，组合粘贴等巧妙工艺制成。沈阳市羽毛工艺厂首创羽毛画工艺，以“清秀淡雅，格调新颖”而闻名于世。制作的古典人物栩栩如生，花鸟更是绚丽多彩。羽毛画是旅游纪念和馈赠佳品，现在的沈阳羽毛画远销国外', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('416', '210100RS0017', '凯宾斯基酒店', 'Hotel', '参考价格1035', '沈阳凯宾斯基饭店蝉联第七届中国酒店“金枕头奖”。 凯宾斯基饭店管理集团是世界上历史悠久的欧洲豪华饭店管理集团，创建于1897年，沈阳凯宾斯基饭店，位于青年大街中心地段，舒适的豪华湖景房将南运河及青年湖尽收眼底，百年谭府佳肴的御龙轩中餐厅，巴伐利亚风情的普拉那啤酒坊，3500平方米的水疗康体中心以及具有凯宾斯基品牌特色的凯宾服务必将令您的商旅之行锦上添花！', '', '沈河区青年大街109号', '1', '1', '024-22988988转前台', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('417', '210100RS0018', '华府天地莱星顿酒店', 'Hotel', '参考价格638-788', '沈阳华府天地莱星顿酒店隶属于美国优势酒店集团旗下品牌莱星顿酒店有限公司，是一家豪华地标式酒店', '', '沈河区哈尔滨路128号', '1', '1', '024-22598888', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('418', '210100RS0019', '沈阳世纪国际大酒店', 'Hotel', '参考价格318', '是澳洲太平洋国际酒店集团管理的一家商务酒店，地处繁华的太原街商业中心', '', '和平区中华路88号', '1', '1', '024-23402888-4579', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('419', '210100RS0020', '瑞心东方酒店', 'Hotel', '参考价格160', '隶属于沈阳铁道旅游实业发展集团公司。2003年顺利通过“中国绿色饭店”申请，成为沈阳地区首家申报国家级审核的，以“绿色餐饮”，“绿色客房”为特色服务的饭店', '', '沈河区北站路112号', '1', '1', '024-22583218', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('42', '530100RS0022', '云南食用菌', 'Food', '50元左右每斤。', '云南地处云贵高原，山多林茂，气候温和，雨量充沛，夏秋两季，时晴时雨，为食用菌的生长繁殖提供了极其有利的自然条件。云南食用菌品种繁多，风味各异，在滇味菜肴中是名贵的“山珍”。其中最具经济价值的是鸡枞、松茸、竹荪，此外还有牛肝菌、羊肚菌、青头菌、干巴菌、猴头菇等。', '', '', '1', '1', '', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('420', '210100RS0021', '格林豪泰酒店', 'Hotel', '参考价格199', '格林豪泰（沈阳领事馆店）属全国商务连锁酒店，总部在上海，并且是东北首家店、沈阳第一家格林豪泰酒店', '', '和平区十四纬路14号', '1', '1', '024-23862333', '0', '', '', '0');
INSERT INTO `t_cityresources_cn` VALUES ('421', '210100RS0022', '腾远商务宾馆', 'Hotel', '参考价格128', '沈阳腾远商务宾馆-新玛特店是隶属于沈阳腾远企业旗下商务宾馆连锁公司的第一家直营店，坐落于沈阳最古老又繁华的商业街区中街，毗邻世界古文化遗产——沈阳故宫，与长安寺、张氏帅府、太清宫、清真南寺等文物古迹仅举步之遥，文化底蕴浓厚，便于旅者访古探幽', '', '东区小东路1号新玛特购物休闲广场12-19层', '1', '1', '024-24352111', '0', '', '', '0');
